import React from 'react';
import ReactDOM from 'react-dom/client';
import Login from './Pages/Login/Login';
import GlobalStyle from './Pages/Styles/Global';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <GlobalStyle/>
    <Login />
  </React.StrictMode>
);
